import React, { Component } from 'react';
import './Comments.css';

class Comments extends Component {
    
    render() { 
        return (  
            <div>
            <div class="warning" id="no_go"></div>
            <div className="commentbox-app">
            <div className="container">
            <h1 className="heading">commentbox</h1>
            <div className="clearfix">
            <form id="comment-form">
            <input type="text" id="comment-input" className="comment-input" placeholder="Thoughts"/>
            <input type="submit" value="Post" className="comment-btn"/>
            </form>
            </div>
            <ul id="comment-stream" className="comment-stream">
            </ul>
            </div>
            </div>
            </div>
        );
    }
}
 
export default Comments;
